//blog.xiongdong57.top/multi-period-inventory-models/":{"tf":1.0},"https://blog.xiongdong57.top/newsvendor-model/":{"tf":1.0}},"df":3}}}},"u":{"docs":{},"df":0,"l":{"docs":{},"df":0,"t":{"docs":{},"df":0,"i":{"docs":{"https://blog.xiongdong57.top/multi-period-inventory-models/":{"tf":1.0}},"df":1}}}}},"n":{"docs":{},"df":0,"e":{"docs":{},"df":0,"w":{"docs":{},"df":0,"s":{"docs":{},"df":0,"v":{"docs":{},"df":0,"e":{"docs":{},"df":0,"n":{"docs":{},"df":0,"d":{"docs":{},"df":0,"o":{"docs":{},"df":0,"r":{"docs":{"https://blog.xiongdong57.top/newsvendor-model/":{"tf":1.0}},"df":1}}}}}}}}}},"o":{"docs":{},"df":0,"r":{"docs":{},"df":0,"a":{"docs":{},"df":0,"c":{"docs":{},"df":0,"l":{"docs":{"https://blog.xiongdong57.top/linux-server/":{"tf":1.0}},"df":1}}}}},"p":{"docs":{},"df":0,"a":{"docs":{},"df":0,"n":{"docs":{},"df":0,"d":{"docs":{},"df":0,"a":{"docs":{"https://blog.xiongdong57.top/modern-pandas/":{"tf":1.0}},"df":1}}}},"e":{"docs":{},"df":0,"r":{"docs":{},"df":0,"i":{"docs":{},"df":0,"o":{"docs":{},"df":0,"d":{"docs":{"https://blog.xiongdong57.top/multi-period-inventory-models/":{"tf":1.0}},"df":1}}}}},"r":{"docs":{},"df":0,"o":{"docs":{},"df":0,"c":{"docs":{},"df":0,"e":{"docs":{},"df":0,"s":{"docs":{},"df":0,"s":{"docs":{"https://blog.xiongdong57.top/process-analysis/":{"tf":1.0}},"df":1}}}}}}},"s":{"docs":{},"df":0,"e":{"docs":{},"df":0,"r":{"docs":{},"df":0,"v":{"docs":{},"df":0,"e":{"docs":{},"df":0,"r":{"docs":{"https://blog.xiongdong57.top/linux-server/":{"tf":1.0}},"df":1}}}}}},"t":{"docs":{},"df":0,"r":{"docs":{},"df":0,"i":{"docs":{},"df":0,"c":{"docs":{},"df":0,"k":{"docs":{"https://blog.xiongdong57.top/modern-pandas/":{"tf":1.0}},"df":1}}}}}}}},"documentStore":{"save":true,"docs":{"https://blog.xiongdong57.top/":{"body":"","id":"https://blog.xiongdong57.top/","title":""},"https://blog.xiongdong57.top/advent-of-code-2021/":{"body":"This year I will do Advent of Code 2021. Considering my programming skills, Python will be used. This article will record simple descriptions of the problems, some of my solution and little notes, which should be updated everyday between December 1st and December 25th. The complete code and data be available on GitHub.\nutils.py\n\nDay 1: Sonar Sweep\nYou had the following report:\n199\n200\n208\n210\n200\n207\n240\n269\n260\n263\n\nHow many measurements are larger than the previous measurement?\nConsider sums of a three-measurement sliding window. How many sums are larger than the previous sum?\n\n\nDay 2: Dive!\nInput be like:\nforward 5\ndown 5\nforward 8\nup 3\ndown 8\nforward 2\npart1 with rule:\n\nforward X increases the horizontal position by X units.\ndown X increases the depth by X units.\nup X decreases the depth by X units.\n\npart2 with rule:\n\ndown X increases your aim by X units.\nup X decreases your aim by X units.\nforward X does two things:\n\nIt increases your horizontal position by X units.\nIt increases your depth by your aim multiplied by X.\n\n\n\n\nDay 3: Binary Diagnostic\nInput be like:\n00100\n11110\n10110\n10111\n10101\n01111\n00111\n11100\n10000\n11001\n00010\n01010\npart1 with rule:\n\ngamma rate can be determined by finding the most common bit in the corresponding position of all numbers in the diagnostic report\nepsilon rate is calculated in a similar way; rather than use the most common bit, the least common bit from each position is used\nWhat is the power consumption of the submarine(gamma rate multiplied by epsilon rate)\n\npart2 with rule:\n\nKeep only numbers selected by the bit criteria for the type of rating value for which you are searching. Discard numbers which do not match the bit criteria.\nIf you only have one number left, stop; this is the rating value for which you are searching. Otherwise, repeat the process, considering the next bit to the right.\n\nThe bit criteria depends on which type of rating value you want to find:\n\nTo find oxygen generator rating, determine the most common value (0 or 1) in the current bit position, and keep only numbers with that bit in that position. If 0 and 1 are equally common, keep values with a 1 in the position being considered.\nTo find CO2 scrubber rating, determine the least common value (0 or 1) in the current bit position, and keep only numbers with that bit in that position. If 0 and 1 are equally common, keep values with a 0 in the position being considered.\n\nWhat is the life support rating of the submarine(oxygen generator rating multiplied by CO2 scrubber rating)\n\nDay 4: Giant Squid\nBingo is played on a set of boards each consisting of a 5x5 grid of numbers. Numbers are chosen at random, and the chosen number is marked on all boards on which it appears. (Numbers may not appear on all boards.) If all numbers in any row or any column of a board are marked, that board wins.\nInput be like:\n7,4,9,5,11,17,23,2,0,14,21,24,10,16,13,6,15,25,12,22,18,20,8,19,3,26,1\n22 13 17 11  0\n8  2 23  4 24\n21  9 14 16  7\n6 10  3 18  5\n1 12 20 15 19\n3 15  0  2 22\n9 18 13 17  5\n19  8  7 25 23\n20 11 10 24  4\n14 21 16 12  6\n14 21 17 24  4\n10 16 15  9 19\n18  8 23 26 20\n22 11 13  6  5\n2  0 12  3  7\nscore is the sum of all unmarked numbers multiply that sum by the number that was just called when the board won.\npart1:  What will your final score be if you choose that board\npart2:  figure out which board will win last and choose that one, figure out which board will win last and choose that one\n\nIf this puzzle is more complex, maybe numpy is a good way to go.\nDay 5: Hydrothermal Venture\nFor lines:\n0,9 -&gt; 5,9\n8,0 -&gt; 0,8\n9,4 -&gt; 3,4\n2,2 -&gt; 2,1\n7,0 -&gt; 7,4\n6,4 -&gt; 2,0\n0,9 -&gt; 2,9\n3,4 -&gt; 1,4\n0,0 -&gt; 8,8\n5,5 -&gt; 8,2\nyou need to determine the number of points where at least two lines overlap.\npart1: Consider only horizontal and vertical lines. At how many points do at least two lines overlap?\npart2: Because of the limits of the hydrothermal vent mapping system, the lines in your list will only ever be horizontal, vertical, or a diagonal line at exactly 45 degrees.Consider all of the lines. How many points do at least two lines overlap?\n\nData structure is really a key thing to solve the problem with simple and clean solution.\nDay 6: Lanternfish\nEach lanternfish creates a new lanternfish once every 7 days and a new lanternfish need slightly longer before it's capable of producing more lanternfish: two more days for its first cycle. We model each fish as a single number that represents the number of days until it creates a new lanternfish.\nInput be like:\n3,4,3,1,2\npart1: How many lanternfish would there be after 80 days?\npart2: ow many lanternfish would there be after 256 days\n\nAgain, data structure is the key to the right solution.\nDay 7: The Treachery of Whales\nList of the horizontal position of each crab:\n16,1,2,0,4,2,7,1,2,14\npart1 with rule:\nEach change of 1 step in horizontal position of a single crab costs 1 fuel. Determine the horizontal position that the crabs can align to using the least fuel possible.\nHow much fuel must they spend to align to that position?\npart2 with rule:\nach change of 1 step in horizontal position costs 1 more unit of fuel than the last: the first step costs 1, the second step costs 2, the third step costs 3, and so on\nHow much fuel must they spend to align to that position?\n\nDay 8: Seven Segment Search\nInput be like:\nacedgfb cdfbe gcdfa fbcad dab cefabd cdfgeb eafb cagedb ab | cdfeb fcadb cdfeb cdbaf\nbefore | is the 0-9 numbers, after | can be translate to digits.\nCode be like:\n\npart1: In the output values, how many times do digits 1, 4, 7, or 8 appear?(hints: 1, 4, 7, 8 use a unique number of segments)\npart2: For each entry, determine all of the wire/segment connections and decode the four-digit output values. What do you get if you add up all of the output values?\n\nPart1 is easy, after careful understanding the matiral. Part2 first comes to DFS, then I find it's hard to mapping the iterate rule. Then when broswing reddit, someone mentioned brute force. May be  I should calc how many possible combinations and the result number is quit small(less than 10000). Finally, using brute force to solve it.\nDay 9: Smoke Basin\nconsider the following heightmap:\n2199943210\n3987894921\n9856789892\n8767896789\n9899965678\nYour first goal is to find the low points - the locations that are lower than any of its adjacent locations.Most locations have four adjacent locations (up, down, left, and right). The risk level of a low point is 1 plus its height.\nPart1: What is the sum of the risk levels of all low points on your heightmap?\nA basin is all locations that eventually flow downward to a single low point. Therefore, every low point has a basin, although some basins are very small. Locations of height 9 do not count as being in any basin, and all other locations will always be part of exactly one basin.\nThe size of a basin is the number of locations within the basin, including the low point.\nPart2: What do you get if you multiply together the sizes of the three largest basins?\n\nToday is a simple useage of BFS.\nDay 10: Syntax Scoring\nFrom today, I will not decribe the puzzle, the complete description will be linked.\n\nWhat is the total syntax error score for those errors?\nFind the completion string for each incomplete line, score the completion strings, and sort the scores. What is the middle score\n\n\nA simple usage of recursion. Another approach is to use stack, if the c is open_close, put it into stack, if the c is close_open, pop the stack, after line is completed, the stack should be reduced to corupted and incomplete. And you can here to return the flag of the corupted and incomplete.\nDay 11: Dumbo Octopus\nInput be like a 10*10 number map, represent a enery map. After each iteration, the num changes follow the rule:\n\nFirst, the energy level of each octopus increases by 1.\nThen, any octopus with an energy level greater than 9 flashes. This increases the energy level of all adjacent octopuses by 1, including octopuses that are diagonally adjacent. If this causes an octopus to have an energy level greater than 9, it also flashes. This process continues as long as new octopuses keep having their energy level increased beyond 9. (An octopus can only flash at most once per step.)\nFinally, any octopus that flashed during this step has its energy level set to 0, as it used all of its energy to flash.\n\n\nFor part one, I made a mistake, I think the update_map will not be recursive at first, and take some time and steps to reliaze it. After fix this, the solution is quite simple.\nFor part two, I first thought it will be some large number, but it is not. So the solution not require much effort.\nMaybe next yeaer, I should build a Grid class be represent the map.\nWhen browsing the internet, I found programmer named Jocelyn Stericker using rust to solve Advent of Code 2021 and Peter Norvig using python to solve Advent of Code 2021. Usually, I will solve the puzzle on my own first, then see their solution, which is often shorter and clever.\nDay 12: Passage Pathing\nInput be like:\nstart-A\nstart-b\nA-c\nA-b\nb-d\nA-end\nb-end\n\nbig caves (written in uppercase, like A) and small caves (written in lowercase, like b) .all paths you find should visit small caves at most once, and can visit big caves any number of times.\npart1: How many paths through this cave system are there that visit small caves at most once\npart2: After reviewing the available paths, you realize you might have time to visit a single small cave twice. However, the caves named start and end can only be visited exactly once each. Given these new rules, how many paths through this cave system are there?\n\n\nDay 13: Transparent Origami\nInput be like:\n6,10\n0,14\n9,10\n0,3\n10,4\n4,11\n6,0\n6,12\n4,1\n0,13\n10,12\n3,4\n3,0\n8,4\n1,10\n2,14\n8,10\n9,0\nfold along y=7\nfold along x=5\n\nHow many dots are visible after completing just the first fold instruction on your transparent paper\nFinish folding the transparent paper according to the instructions. The manual says the code is always eight capital letters. What is the code?\n\n\nDay 14: Extended Polymerization\nInput is two part, first is the polymer template, second is a list of pair insertion rules.\nNNCB\nCH -&gt; B\nHH -&gt; N\nCB -&gt; H\nNH -&gt; C\nHB -&gt; C\nHC -&gt; B\nHN -&gt; C\nNN -&gt; C\nBH -&gt; H\nNC -&gt; B\nNB -&gt; B\nBN -&gt; B\nBB -&gt; N\nBC -&gt; B\nCC -&gt; N\nCN -&gt; C\nA rule like AB -&gt; C means that when elements A and B are immediately adjacent, element C should be inserted between them. These insertions all happen simultaneously.Note that these pairs overlap: the second element of one pair is the first element of the next pair. Also, because all pairs are considered simultaneously, inserted elements are not considered to be part of a pair until the next step.\n\npart1: after 10 steps, what is quantity of the most common element and subtract the quantity of the least common element\npart2: after 400 steps, what is quantity of the most common element and subtract the quantity of the least common element\n\n\nThe idea to solve part 1 is to simulate and store the template, which works fine. But for part 2 the length of final template is more than 2 trillion. There is no data strutures to store it, so a different approach is needed.\nPart 2 is mostly reference some great post on this subreddit.\nDay 15: Chiton\nInput is a 2D array of integers, representing the risk map. Such as:\n1163751742\n1381373672\n2136511328\n3694931569\n7463417111\n1319128137\n1359912421\n3125421639\n1293138521\n2311944581\nPart1: What is the lowest total risk of any path from the top left to the bottom right?\nPart2: The actual map is the current map repeat to right or down five times. And after each repeation, the risk are 1 higher, but risk levels above 9 wrap back around to 1. With this new information, what is the lowest total risk of any path from the top left to the bottom right?\n\nToday I learned about the Dijkstra's algorithm, which is used to find the shortest path between two nodes in a graph. Since I know little about it, a lot of time was spent on the algorithm. But after implementing it, the code become much easier.\nDay 16: Packet Decoder\nYou have a hexadecimal input string(such as: D2FE28), first it will be convert to binary, follow a rule(such as: A=1010) which could be parse into data and oporation packet.\nPart1: Decode the structure of your hexadecimal-encoded BITS transmission; what do you get if you add up the version numbers in all packets?\nPart2: With the given operation rule, What do you get if you evaluate the expression represented by your hexadecimal-encoded BITS transmission?\n\nIt's a long day, since there are so many rules to parse the packets. The tricky part is to figure out the data structure to represent the packets. After relizing the packet may be recursive containing other packet, I finally choose json-like data structure to store the packets.\nThe code is a little bit messy, maybe I will refactor it later or maybe not.\nDay 17: Trick Shot\nInput represents the an area of grid, which covered by trajectory. The probe starts from (0, 0), with each iter, the location change by rule with velocity who's loc also change ervery step. The velocity is represented by a tuple of (x, y). For special velocity, the probe will within or not within the target area after some steps.\nPart1: Find the initial velocity that causes the probe to reach the highest y position and still eventually be within the target area after any step. What is the highest y position it reaches on this trajectory.\nPart2: How many distinct initial velocity values cause the probe to be within the target area after any step\n\nUsing brute force to solve this problem.\nDay 18: Snailfish\nThis is a special math.\n\nformal be like: [[1,9],[8,5]]\neach formal must be reduced by the rule:\n\nIf any pair is nested inside four pairs, the leftmost such pair explodes\nIf any pair is nested inside four pairs, the leftmost such pair explodes\nDuring reduction, at most one action applied\nTo explode a pair, the pair's left value is added to the first regular number to the left of the exploding pair (if any), and the pair's right value is added to the first regular number to the right of the exploding pair (if any)\nTo split a regular number, replace it with a pair; the left element of the pair should be the regular number divided by two and rounded down, while the right element of the pair should be the regular number divided by two and rounded up\n\n\nThe magnitude of a pair is 3 times the magnitude of its left element plus 2 times the magnitude of its right element\n\nPart1： Add up all of the snailfish numbers from the homework assignment in the order they appear. What is the magnitude of the final sum?\nPart2: The magnitude of a pair is 3 times the magnitude of its left element plus 2 times the magnitude of its right element?\n\nAt first, I use nested list to represent the formula. But after some try, I can't found a clear way to explode(split works ok). Almost giving up, then the Aoc Subreddit helped me, I see someone use tree structure to represent the formula and other people use string to represent the formula. String? Really? When I see the code, I know string will work better. So I change the solution to use string. Amazing!\nDay 19: Beacon Scanner\n\nscanners report some beacon and the scanner may be rotated by 90 degree in xyz axes and facing positive or negative(24 different orientations).\ntwo scanners near overlapped at least 12 beacons.\n\nPart1: Assemble the full map of beacons. How many beacons are there?\nPart2: Assemble the full map of beacons. How many beacons are there?\n\nToday，I cheated and not found the solution by myself, the origin code is here. I just understand the logic and rewrite some code.\nHonesty is the best policy.\nDay 20: Trench Map\nYou get a 2D image(# represent light, . represent dark) and an algorithm(a seqence contains # and .) to enhence the image.\nWith the enhence rule, the image(infinite) will change the light and dark pixel.\n\nthe pixel beyound the image will be initialized as dark(represent by .)\nto determine the pixel after enhencing, combine the nine neighbors(from left-top to right-down, including itself) and convert # to 1 and . to 0\nthen convert the binary number to decimal number(such as '000100010' to 34)\nuse the decimal number to determine the pixel after enhencing(index of the algorithm)\nall pixel change simultaneously\n\nPart1: Start with the original input image and apply the image enhancement algorithm twice, being careful to account for the infinite size of the images. How many pixels are lit in the resulting image?\nPart2: Start again with the original input image and apply the image enhancement algorithm 50 times. How many pixels are lit in the resulting image?\n\nThe tricky part is the algorithm start with a # and end with a ., which means the infinate pixel far away from the origin image will blink every(2 enhence steps).\nThe 1st step, the nine neighbors of the pixel are all ., so the binary number will be 000000000, which will change the pixel to #.\nThe 2nd step, the nine neighbors of the pixel are all #, so the binary number will be 111111111, which will change the pixel to \".\".\nDidn't realize that at first, so spending a lot of time to debug. Auctally, it's easy if you find out the above tricky part.\nDay 21: Dirac Dice\nTwo player play a dirac dice game.\n\neach player roll a dice three times\nthe player move(around 1 to 10) follow the dice number(if greater than 10, then move to 1)\nwith each move, the player's score increase by the position of the player(after move)\n\nPart1:\n\nthe dice is deterministic with 100-sided(meaning the dice rolls 1, 2...100...1)\nthe player who's score is greater than 1000 wins\nquestion: what do you get if you multiply the score of the losing player by the number of times the die was rolled during the game?\n\nPart2:\n\nthe dice is quantum, when you roll it, the universe splits into 3 copys: one where the outcome of the roll is 1, one where the outcome of the roll is 2, and one where the outcome of the roll is 3.\nthe player who's score is greater than 24 wins\nquestion: find the player that wins in more universes; in how many universes does that player win?\n\n\nPart one is easy, just follow the rules. Part two is kind of hard to code. I finally refrenced the solution from reddit post.\nDay 22: Reactor Reboot\nThe reboot process is followed by steps to turn on or turn off the grid(like: on x=11..13,y=11..13,z=11..13, off x=9..11,y=9..11,z=9..11).\nPart1: execute the reboot steps. Afterward, considering only cubes in the region x=-50..50,y=-50..50,z=-50..50, how many cubes are on?\nPart2: Starting again with all cubes off, execute all reboot steps. Afterward, considering all cubes, how many cubes are on?\n\nDay 23: Amphipod\nYou get a 2D map(# represents a wall, . represents an open space) of the area(below is an example). Moving each ABCD need different evergy.\nPart1: Your task is to find the least energy for move everyone to it's room(ABCD as blow).\n\nPart2: The actual map is folded, a two line to the map(blow is an example). And find the least energy for move everyone to it's room.\n\n\nA Dijkstra search with greedy heuristic. I didn't solve this with my own. The code is referenced from here. My origin approach is too complicated to apply a Dijkstra search.\nIt's still fun to play to understand how clever other people's solution is.\nDay 24: Arithmetic Logic Unit\nYou are going to build a new kind of computer. With blow rule:\n\ninp a - Read an input value and write it to variable a.\nadd a b - Add the value of a to the value of b, then store the result in variable a.\nmul a b - Multiply the value of a by the value of b, then store the result in variable a.\ndiv a b - Divide the value of a by the value of b, truncate the result to an integer, then store the result in variable a. (Here, \"truncate\" means to round the value toward zero.)\nmod a b - Divide the value of a by the value of b, then store the remainder in variable a. (This is also called the modulo operation.)\neql a b - If the value of a and b are equal, then store the value 1 in variable a. Otherwise, store the value 0 in variable a.\nsubmarine model numbers are always fourteen-digit numbers consisting only of digits 1 through 9.\nafter MONAD has finished running all of its instructions, it will indicate that the model number was valid by leaving a 0 in variable z. However, if the model number was invalid, it will leave some other non-zero value in z\n\nPart1: What is the largest model number accepted by MONAD?\nPart2: What is the smallest model number accepted by MONAD?\n\nI havn't heard of Z3. The solution is from reddit.\nThere is another approach is to analysis the input sequence(which will have special case to solve this problem because of the simularity of each-14 part). But I still like the Z3 approach, which is more elegant and generic.\nDay 25: Sea Cucumber\n\nyou got a 2D map of the area(. represent emply, &gt; represent east-facing creature and V represent south-facing creature, example as blow).\nAt each step, east-facing creature will move forward one step if the next-east is empty, south-facing creature will move down one step if the next-south is empty.\nsea cucumbers that move off the right edge of the map appear on the left edge, and sea cucumbers that move off the bottom edge of the map appear on the top edge.\n\n\nQuestion: To find a safe place to land your submarine, the sea cucumbers need to stop moving. How many steps does it take for the sea cucumbers to stop moving?\n\nA kind of simple simulation.\nConclusion\nAt last, this year of adventofcode come to the end. Although some of the problems are too hard, I can't solve it on my own, but it's still a lot of fun to follow the clear thought and solution shared through reddit, github and youtube, from which I have learned so many things.\nThank you Eric the authors of the advent of code, the community and people who share their thought and solution.\n","id":"https://blog.xiongdong57.top/advent-of-code-2021/","title":"Advent of Code 2021"},"https://blog.xiongdong57.top/eoq-model/":{"body":"库存管理是供应链管理的核心之一。持有库存有很多原因，包括：1. 平衡需求和供给；2. 降低运营成本；3. 缓冲需求和制造方面的不确定性。在现实世界中，产品从生产、运输到商家、商家再配送给客户的过程中往往需要相当长的时间。商家通常会持有一定水平的库存量，当客户有需求的时候，可以第一时间交付，当商家持有库存不足时，由于无法满足需求，可能会失去销售机会。但是，持有过多的库存会有较高的库存持有成本甚至会影响到企业现金流，而且库存也存在过期、变质、损坏的风险。\n库存管理本质上是确定合适的产品在合适的位置以合适的形式的数量。战略决策包括产品层面和网络设计的影响。战术决策包括部署和确定携带什么物品，以什么形式（原材料、在制品、成品等），以及在哪里。最后，运营决策决定了这些库存的补货政策（何时和多少），寻求能使这些总成本最小化的补货策略。补货策略本质上需要说明两件事：要订购的数量，以及何时订购。\n不同的补货策略模型对应不同的需求和供应的假设（需求是常量还是变量，确定还是随机等）。这里首先从介绍 EOQ Model。\nEOQ Model介绍\nEOQ Model假设\n\nDemand: constant, known and continuous\nLead Time: Instantaneous\nDependence of Items: Independent\nReview Time: continuous\nCapacity/Resource: Unlimited\nDiscounts: None\nExcess Demand: None\nPerishability: None\nPlanning Horizon: Infinite\nNumber of Items: One\nForm of Product: Single Stage\n\n使用EOQ Model一定要注意模型的初始假设是否满足，尤其是均一、确定且长期保持稳定不变的需求，lead time 为0，以及整批货物一起收到。\nEOQ Model 库存管理策略\n\n每隔 \\(T^\\ast \\) 的时间预定 \\(Q^\\ast \\)\n当库存低于0时，预定 \\(Q^\\ast \\)\n\nEOQ Model 推导\n先做如下定义：\n\nD: 平均需求量\nc: 每个产品的采购单价\n\\(c_t\\)：订单执行成本（和订单次数有关，比如固定的清关费用等）\n\\(c_e\\)：库存持有成本（通常高于资金成本）\n\\(c_s\\)：缺货成本\nQ: 每次订购量\nT: 每次订购间隔\nN=1/T: 单位时间订购次数\nTC(Q): 总成本\nTRC(Q): 总相关成本\n\\(Q^\\ast\\): 总成本最低的最佳订购量\n\n总成本可以表示为：TC = Purchase + Order + Holding + Shortage。在EOQ 模型的假设下可以可以改写为：\n$$ TC(Q) = cD + c_t\\frac D Q + c_e\\frac Q 2+ c_sE[UnitsShort] $$\n其中，采购成本 cD 和短缺成本 \\(c_sE[UnitsShort]\\) 和单次订购数量无关，所以问题可以简化为求如下等式的最小值：\n$$ TRC(Q) = c_t\\frac D Q + c_e\\frac Q 2 $$\n求解上述表达式一次导数为0时，即为 \\(Q^\\ast\\)：\n$$ \\frac {dTRC(Q)} {dQ} =  -c_t\\frac D {Q^2} + \\frac {c_e} 2 = 0 \\newline\n\\frac {c_e} 2 = c_t\\frac D {Q^2} \\newline\nQ^\\ast = \\sqrt{\\frac {2c_t D} {c_e}} $$\n求解二次导数，也会发现恒大于0，所以一次导数为0时，即为最小值。\n$$ \\frac {d^2TRC(Q)} {d^2Q} = \\frac {2c_tD} {Q^3} &gt; 0 $$\n求解 \\(T^\\ast\\):\n$$ T^\\ast = \\frac {Q^\\ast}{D} = \\sqrt{\\frac {2 c_t D} {c_e}}{\\frac 1 D} = \\sqrt{\\frac {2 c_t} {c_e D}} $$\n求解\\(TRC(Q^\\ast)\\):\n$$ TRC(Q^\\ast) = c_t\\frac D {Q^\\ast} + c_e\\frac {Q^\\ast} 2 = \\sqrt {2 c_t c_e D} \\newline\nTC(Q^\\ast) = cD + \\sqrt {2 c_t c_e D} $$\nEOQ Model Analysis\nSensitivity to Order Quantity\n$$ \\frac {TRC(Q)} {TRC(Q^\\ast)} = \\frac {c_t\\frac D Q + c_e\\frac Q 2} {\\sqrt {2 c_t c_e D}} \\newline\n= \\frac {c_tD} {Q \\sqrt {2 c_t c_e D}} + \\frac {c_eQ} {2\\sqrt {2 c_t c_e D}} \\newline\n= \\frac {\\sqrt{c_tD}} {Q \\sqrt{2c_e}} + \\frac {\\sqrt{c_e}Q} {2\\sqrt {2 c_t D}} \\newline\n= (\\frac {\\sqrt2} {\\sqrt2})\\frac {\\sqrt{c_tD}} {Q \\sqrt{2c_e}} + \\frac {\\sqrt{c_e}Q} {2\\sqrt {2 c_t D}} \\newline\n= \\frac {\\sqrt{2c_tD}} {2Q \\sqrt{c_e}} + \\frac {\\sqrt{c_e}Q} {2\\sqrt {2 c_t D}} \\newline\n= (\\frac 1 2)(\\frac {\\sqrt{2c_tD}} {Q \\sqrt{c_e}} + \\frac {\\sqrt{c_e}Q} {\\sqrt {2 c_t D}}) \\newline\n= (\\frac 1 2)(\\frac {Q^\\ast} Q + \\frac Q {Q^\\ast}) $$\n根据上面的公式，计算使用不同的Q对总的TRC的影响:\n\\(\\frac Q {Q^\\ast}\\)\\(\\frac {TRC(Q)} {TRC(Q^\\ast)}\\)\n300%167%\n200%125%\n150%108%\n50%125%\n\n从上述表格中可以看出，EOQ 模型对订购量Q相当稳定，即使Q比最优的\\(Q^\\ast\\)翻倍或者减少50%，TRC也只增加25%。\nSensitivity to Demand\n既然EOQ 模型对订购量Q的变化非常稳定，那么如果考虑最初的假设，使用的时需求（D），如果使用预测（F）来替代对TRC会有多大的影响呢？尤其是考虑到预测往往会和实际需求有偏差。\n$$ {Q ^ \\ast}_F = \\sqrt{\\frac {2c_t D_F} {c_e}} \\newline\n{Q ^ \\ast}_A = \\sqrt{\\frac {2c_t D_A} {c_e}} \\newline\n\\frac {{Q ^ \\ast}_F} {{Q ^ \\ast}_A} = \\sqrt{ \\frac {D_F} {D_A} } \\newline\n\\frac {TRC(Q)} {TRC(Q^\\ast)} = (\\frac 1 2)(\\frac {Q^\\ast} Q + \\frac Q {Q^\\ast})  \\newline\n\\frac {TRC({Q ^ \\ast}_F)} {TRC({Q ^ \\ast}_A)} = (\\frac 1 2)(\\frac {{Q ^ \\ast}_A} {Q ^ \\ast}_F + \\frac {{Q ^ \\ast}_F} {{Q ^ \\ast}_A}) \\newline\n= (\\frac 1 2)(\\sqrt { \\frac {D_A} {D_F} } + \\sqrt { \\frac {D_F} {D_A} }) $$\n对比上述公式和EOQ对Q的稳定程度，可以看出即使预测的偏差在50%或者200%之间，TRC的变化也会非常小（1.06%）。但是这里一定要留意，EOQ 模型比较的是TRC对预测非常稳健（且需求是长期且稳定的的假设不变），并不是说任何时候都可以适用，尤其是当TRC不是优先考虑的因素时。\nSensitivity to Order Cycle Time\n根据同样的方程，可以得出：\n\\[\\frac {TRC(T)} {TRC(T^\\ast)} = (\\frac 1 2)(\\frac T {T^\\ast} + \\frac {T^\\ast} {T}) \\]\n和订购量Q一样，EOQ 模型对间隔订购时间（T）没有严格的要求。使用不同的T，对最终的TRC影响不大。\nsummary\n通过上述分析可以看到，EOQ模型有非常严格的假设要求，但是仍然有非常广泛的用途。当存在长期且稳定的需求时，EOQ模型都是一个很好的开始，可以根据实际情况调整Q。EOQ模型平衡的是库存持有成本和订购成本，当有其它的考虑因素时，可以知道即使Q偏离\\(Q^\\ast\\)，那么也可以预估TRC的变化幅度。另外一点需要注意的是TRC只是TC的一部分，那么TC的变化幅度则会更小。\nEOQ模型对采购量（Q），订购周期（T），预测误差（F）等的变化都非常稳健。同样的，对于模型设定的参数，\\(c_t\\)、\\(c_e\\)等的误差，结果也是非常稳定的。\n\nEOQ model is a good start point, but not always a good end point.\n\nEOQ Model Extension\nEOQ模型有非常严格的约束条件，下面会分别到了Lead Time 不为0对订购数量和订购时间的影响，以及存在折扣时EOQ模型如何变化。\nExtension with non-zero lead time\n当Lead Time 不为零时，EOQ 模型的总成本中，TC = Purchase + Order + Holding + Shortage, 其中，Purchase、Order、Shortage cost不会变化，而 Holding cost会变化。首先来看总库存（在库+在途）的变化:\n\ncycle time = \\(T^\\ast = \\frac {Q^\\ast} D \\)\naverage pipeline inventory = \\({Q^\\ast}(\\frac L {T^\\ast}) + 0(1 - \\frac L {T^\\ast}) = \\frac {Q^\\ast L} {T^\\ast} = \\frac {Q^\\ast L} {\\frac {Q^\\ast} D} = DL \\)\n\n根据商务条款的不同，在途库存有可能会需要纳入考虑（比如EXW），这里假设在途库存的 Holding cost也需要考虑。那么新的TC方程可以表示为：\n$$ TC(Q) = cD + c_t\\frac D Q + c_e(\\frac Q 2 + DL)+ c_sE[UnitsShort] $$\n根据前面的推导，可以得出，Lead Time(L) &gt; 0时，最佳订购量\\(Q^\\ast\\)不会发生变化。真正会影响的是补货的时间点，为了避免缺货，L&gt;0时的补货策略更新为：\n\n当库存低于DL时，预定 \\(Q^\\ast \\)\n每隔 \\(T^\\ast \\) 的时间预定 \\(Q^\\ast \\)\n\nExtension with discount rate\n这里分别讨论如下三种形式的折扣：\n\n当订购数量达到\\(Q_1\\)时，所有产品都享受折扣\n只有超过\\(Q_1\\)的部分才享受折扣\n一次性折扣（没有数量限制）\n\nAll Units Discount\n这种情况下，采购单价c和TRC方程可以表示为:\n$$\nc = \\begin{cases}\nc_0 &amp; \\text{if } {0 \\le Q&lt;Q_1}\n\\\\c_1 &amp; \\text{if } {Q_1 \\le Q}\n\\end{cases}\n$$\n$$\nTRC = \\begin{cases}\nDc_0 + \\frac {c_tD} Q + \\frac {c_0hQ} 2 &amp; \\text{   }  {0 \\le Q&lt;Q_1}\n\\\\Dc_1 + \\frac {c_tD} Q + \\frac {c_1hQ} 2 &amp; \\text{   }  {Q_1 \\le Q}\n\\end{cases}\n$$\n求解过程如下：\n\n求解\\(Q_{c0}^\\ast\\)和\\(Q_{c1}^\\ast\\)\n如果\\(Q_{c1}^\\ast\\) &gt; \\(Q_1\\)，那么选择\\(Q_{c1}^\\ast\\)，否则进入3\n求解\\(TRC(Q_{c0}^\\ast)\\)和\\(TRC(Q_1)-c_1\\), 如果前者更小，那么选择\\(Q_{c0}^\\ast\\)，否则选择\\(Q_1\\)\n\nIncremental Discount\n只有超过\\(Q_1\\)的部分才享受折扣。当订购数量低于\\(Q_1\\)时，采购单价保持\\(c_0\\)不变，当订购数量达到\\(Q_1\\)时，低于\\(Q_1\\)的部分采购单价仍为\\(c_0\\)，高于\\(Q_1\\)的部分采购单价为\\(c_1\\)。这种情况下，当订购数量高于\\(Q_1\\)时，可以等价为订购数量的采购单价都为\\(c_1\\)，再加上每次订购会产生固定成本\\(F = (c_0 - c_1)Q_1\\)。那么，\n$$ Q_1^\\ast = \\sqrt{\\frac {2(c_t + F_i) D} {c_e}} $$\n求解过程如下：\n\n求解\\(TRC(Q_1^\\ast)\\) 和 \\(Q_1^\\ast\\)\n如果 \\(Q_1^\\ast &gt; Q_1\\), 比较\\(TRC(Q_1^\\ast)\\)和\\(TRC(Q^\\ast)\\)，选择较小的那个\n\nsummary\nEOQ 模型的简洁和稳健容易导致误用，尤其是没有充分考虑模型要求的前置假设（稳定、均一和已知的需求）而盲目套用。\n","id":"https://blog.xiongdong57.top/eoq-model/","title":"EOQ Model"},"https://blog.xiongdong57.top/linux-server/":{"body":"Oracle Cloud Linux Server 基础配置\n\n\n通过密码登录 SSH\n\n切换到 root 用户: sudo su\n设置 root 密码: passwd\n修改 sshd_config: vim /etc/ssh/sshd_config, PermitRootLogin 修改为 yes, PasswordAuthentication 修改为 yes\n重启 sshd: Oracle linux 使用 systemctl restart sshd, Ubuntu 使用 /etc/init.d/ssh restart\n\n\n\n添加用户\n\ncreate new user: sudo adduser username\nchange user password: passwd username\nswitch to user: su username\n\n\n\nv2ray 配置\n\n使用一键脚本:\n\nbash &lt;(curl -sL https://cdn.jsdelivr.net/gh/Misaka-blog/Xray-script@master/xray.sh)\narm 服务器使用: bash &lt;(curl -s -L https://git.io/v2ray.sh)\n\n\ncloudFlare worker:\n\n新建一个 worker, 脚本内容为\n\n\n\n测试 Send，返回 200OK\n复制 Worker地址，填入到 V2ray 伪装域名（Host）中\n地址可以修改为优选的 CloudFlare IP\n\n\n\nsyncthing\n\n\n安装\n\n添加GPG\n  sudo apt-get install curl &amp;&amp;    curl -s https://syncthing.net/release-key.txt | sudo apt-key add -  \n添加源\n  echo \"deb https://apt.syncthing.net/ syncthing stable\" | sudo tee /etc/apt/sources.list.d/syncthing.list  \n安装apt-transport-https\n  sudo apt-get install apt-transport-https  \n更新&amp;安装\n  sudo apt-get update &amp;&amp;    sudo apt-get install syncthing  \n\n\n\n配置\n修改 /home/ubuntu/.config/syncthing/config.xml, 找到:\n\ntls 修改为 \"true\", 127.0.0.1 修改为 0.0.0.0\n\n\n开放端口\n   apt-get install iptables &amp;&amp; iptables -I INPUT -p tcp --dport 8384 -j ACCEPT &amp;&amp; iptables-save   \n上述规则持久化(正常重启后会失效):\n\n\n\n\n\ntransmission\n\n\n安装\n  sudo apt-get install transmission-daemon  \n\n\n配置\n修改 vim /var/lib/transmission-daemon/.config/transmission-daemon/settings.json，参照:\n\n\n\n开放9091端口，参照上述 syncthing 的方式\n\n\n启动 service transmission-daemon start\n\n\n\n\n","id":"https://blog.xiongdong57.top/linux-server/","title":"Oracle Cloud Linux Server Configuration"},"https://blog.xiongdong57.top/modern-pandas/":{"body":"工作中偶尔会用到Pandas处理数据，Pandas功能丰富，也有很多不同的使用方式。以下纪录一些自己觉得比较有意思的用法。\nMethod Chain\n先看一段样例代码\n\n这段代码中，进行了清除重复行、合并不同的DataFrame，对DataFrame的列进行清理等。这些都是数据处理中经常会遇到的任务。\n这里的问题是，当这种处理逻辑比较多的时候，会出现几十行面条一样的代码，可读性很差，也难以维护（尤其在字段名称有中文的时候）。\n这时候可以使用pandas.DataFrame.method chain来优化处理。\nPandas DataFrame 的 method chain，可以把多个方法放在一起。上述代码可以改写为：\n\n上述Method chain 由以下部分组成：\n\nDataFrame.drop_duplicates() 等Pandas自带的，默认返回一个DataFrame的API\nDataFrame.assign(**kwargs) 在DataFrame中添加列，列的值根据传入的kwargs进行计算\nDataFrame.pipe(func, *args, **kwargs) 将用户自定义的方法引入到Method chain中\n\nDataFrame.assign\nDataFrame.assign(**kwargs) 作为df['key'] = value的替代，用来添加/替换列，且直接返回一个新的DataFrame对象，默认不会修改原有的DataFrame。\n比如\n\n另外，pandas的很多方法可以接收类似key=func的参数，assgin也一样。可以使用类似于\ndf = df.assign(col1_demeaned=lambda x: x.col1 - x.col1.mean())这样的写法。\nDataFrame.pipe\ndf.pipe(func)等价于func(df)，但是df.pipe(func)的优势在于，当连续调用多个方法的时候，可以使用类似 pipeline的写法，提高可读性。比如：\n\n同时DataFrame.pipe也是直接返回一个新的DataFrame，默认不修改原有的DataFrame。\n使用Method Chain可以将数据处理的逻辑整合到一起，提升可读性。但是，凡事过犹不及，Method Chain也可能被滥用。\n不合理的代码组织，混乱的处理逻辑都可能导致可读性变差。同时过长的Method Chain也会导致Debug变得困难。\n需要注意的是，对于Method Chain过长的情况，可以通过合并处理逻辑到一个Method，通过一个DataFrame.pipe调用来优化。\nTimeSeries\nTimeSeries Slice\n\nPandas 的 TimeSeriesIndex，可以传入字符串，比如ts['2021/1/1']或者ts['20210102]，甚至可以传入年或者年月的字符串进行筛选，比如ts['2021'] 或者ts['2021-01'].Slice也完成可以直接用字符串，\n比如ts['20110101':'20210105']\n也可以传入Datetime对象，比如ts[datetime(2021, 1, 2)]这样。\n甚至还可以传入timestamp，灵活性非常高。\nTimeSeries Resample\nTimeSeries的聚合可以直接使用pandas.DataFrame.resample。根据传入freq，比如Y或者YM等进行聚合。如ts.resample('M', kind='period').mean()\n如果需要生成更低维度（频率）的数据，可以使用DataFrame.asfreq(freq, method=None, how=None, normalize=False, fill_value=None).比如ts.asfreq('4H').ffill()\n","id":"https://blog.xiongdong57.top/modern-pandas/","title":"Pandas Tricks"},"https://blog.xiongdong57.top/multi-period-inventory-models/":{"body":"前面介绍了 EOQ Model 和 Single Period Model，分别对应稳定的需求和随机的需求且仅有一次补货机会。现实世界，往往都在这两个极端情况的中间地带，根据不同的行业会有不同的偏向。这里介绍更加一般的情况。\n库存管理评估体系\n在库存管理中，评价指标可以分为两类，一类是从服务水平上评估，另一类是从总成本上评估（二者都和安全库存和设定有关）。\n从服务水平角度出发，通常使用的指标有 Cycle Service Level(CSL) 和 Item Fill Rate(IFR)。CSL 指的是每个周期内的服务水平（类似于100个周期内有几个周期的库存低于需求）；IFR 指的是每个周期内的需求数量满足比率。通常 IFR 会比 CSL 高，原因是：即使一个周期内库存低于需求（此时 CSL 为0），但是仍有一部分需求被满足（此时 IFR 大于 0 小于1）。\n$$ CSL = 1- P[Stockout] = 1- P[X &gt; s] = P[X \\le s] \\newline\nIFR = 1 - \\frac {E[US]} Q = 1 - \\frac {\\sigma_{DL} G(k)} Q \\newline\nG(k) = \\frac Q {\\sigma_{DL}}(1 - IFR)\n$$\n其中，k 是安全库存系数。根据上述公式，可以通过 k 计算对应的服务水平，也可以根据服务水平计算出 k 的值。\n从成本的角度出发，可以使用 Cost of Stock Out Event(CSOE) 和 Cost of Item Short(CIS)，这两者需要针对缺货成本给出明确的数值定义（B1 for Stockout Event，\\(c_s\\) for Stockout per Item ）才能计算。\n在 CSOE 中，仍然可以通过成本公式来求解 k：\n$$ TC = cD + c_t(\\frac D Q) + c_e(\\frac Q 2 + k\\sigma_{DL}) + B_1(\\frac D Q)P[X \\ge s] $$\n当上述公式取最小值时：\n$$ k = \\sqrt {2 \\ln \\frac {B_1D} {c_e \\sigma_{DL} Q \\sqrt {2 \\pi}}} $$\n在 CIS 中，\n$$ TC = cD + c_t(\\frac D Q) + c_e(\\frac Q 2 + k\\sigma_{DL}) + c_s \\sigma_{DL} G_u(k)(\\frac D Q) $$\n当上述公式取最小值时：\n$$ P[Stockout] = P[x \\ge k] = \\frac {Qc_e} {Dc_s} $$\n整体而言，CSL、IFR、COSE 和 CIS，四者都和 k 关联。所以，其中一项指标确定，都可以通过先计算 k 的值然后计算另外三项，也就是说四者是互相关联的。\n安全库存(Safety Stock)\n无论采用何种评估体系，最终都会涉及到安全库存。安全库存的计算公式如下：\n$$ Safety \\space Stock = k\\sigma_{DL}$$\n其中，k 是安全库存系数，可以根据需求分布和服务水平来确定。\\(\\sigma_{DL}\\) 的定义是：在 lead time 内需求的标准差。但是在实际应用中，通常用预测来替代需求（请留意，二者是不同的）。从这个层面来讲，\\(\\sigma_{DL}\\) 应该是在 lead time 内需求和预测的差值的标准差，也就是 RMSE。原因是：如果预测和真实需求完全一致，那么就不应该有安全库存（因为每个时间点的预测都是实际需求）；即使预测或者需求在未来的不同时间点或者时间段有变化，那么这些变化应该算作 seasonality。在没有 RMSE 的情况下，可以选择用预测的在 lead time 内的标准差来替代。\n库存管理策略介绍\n常见的库存管理策略可以分为如下几类，其中 EOQ Model 和 Single Period Model(Newsvendor model) 分别都在另外的文章有专门介绍，这里不再展开。\nEOQ\n\nOrder \\(Q^\\ast\\) every \\(T^\\ast\\) periods\nOrder \\(Q^\\ast\\) every when \\(IP = \\mu_{DL}\\)\n\nSingle Period\n\nOrder \\(Q^\\ast\\) at start of period where \\(P[x \\le Q] = CR\\)\n\nBase Stock Policy\n基本策略如下：\n\na one-for-one replacement\nOrder what was demand when it was demanded in the quantity of it was demanded\n\n在这种策略下，如果销售了4个，那么就预定4个（适用于 7-11 门店补货这类补货周期较短的业务模式）。这个策略对应的参数如下：\n\nOptimal Base Stock: \\(S^\\ast = \\mu_{DL} + k_{LOS}\\sigma_{DL} \\)\nLevel of Service(LOS): \\(LOS = P[\\mu_{DL} \\le S^\\ast = CR] = \\frac {c_s} {c_s + c_e}\\)\n\nContinuous Review Policy(s, Q)\n基本策略如下：\n\nOrder \\(Q^\\ast\\) when \\(IP \\le s\\)\n\n其中，s 又称为再补货点，当库存低于 s 的时候，预定 \\(Q^\\ast\\)。其中的 \\(Q^\\ast\\) 可以通过 EOQ model 求解。这种模式偏向于需求相对稳定的产品，同时假定 Review Period 为0。\n这个策略对应的参数如下：\n\nReorder Point: \\(s = \\mu_{DL} + k\\sigma_{DL} \\)\nOrder Quantity: 通过 EOQ moddel 求解\n\nPeriodic Review Policy(R, S)\n\nOrder up to S every R time periods\n\nPeriodic Review Policy(R, S) 和 Continuous Review Policy(s, Q) 的区别在于：前者添加了 Review time（R），更加符合实际情况。\n这个策略对应的参数如下：\n\nOrder UP to Point: \\(S = \\mu_{DL + R} + k\\sigma_{DL + R} \\)\n\nSKU 分类\n上述补货策略针对的都是单一 SKU，然而现实世界中，需要管理的 SKU 可能会有很多。这种情况下，将相似类别的产品进行分类，为每个类别设置不同的补货策略可以节省时间和精力。\n从经验上来说，按照销量，销售额或者利润额来进行降序排列，约10%的产品贡献50%的销量，50%的产品贡献约80-90%的销量，剩余的产品都是长尾。这种现象被称为 power law，在天文、气象、人口、心理学、生物学、经济学中都有类似的现象。\n可以据此将产品分为ABC类，最多的精力放在A类产品上，频繁关注和 Review，策略是尽可能准确细致；B类产品通过设定规则（CSL、安全库存等）来进行管理，上述的补货策略主要针对的也是这类产品；C类产品尽可能少放精力，策略越简单越好（即使牺牲部分准确度）。\n","id":"https://blog.xiongdong57.top/multi-period-inventory-models/","title":"Multi Period Inventory Models"},"https://blog.xiongdong57.top/newsvendor-model/":{"body":"在 EOQ 模型中，假定需求是长期的、固定的常量，且 lead time 为0，然后求解使得整体成本最低的最佳订购量（break-even analysis）。作为对比，在 Newsvendor model(或者single period model)，需求是随机的，lead time 大于销售周期（也就是说有且仅有一次订购机会）。在这些限制条件下，评估如何确认最佳订购量和期望利润。\n模型假设\n\nDemand: variable, random and continuous\nLead Time: all inventory be ordered prior to the start of the time period, no replenished during the time period\nDependence of Items: Independent\nReview Time: continuous\nCapacity/Resource: Unlimited\nDiscounts: None\nExcess Demand: Lost orders\nPerishability: None\nPlanning Horizon: Single Period\nNumber of Items: One\nForm of Product: Single Stage\n\n考虑卖报纸的商家，在每天开始之前需要确定当天订购的数量。如果实际需求大于订购数量，报纸会卖完，同时也会损失销售机会（因为原本可以卖更多）；如果需求小于订购数量，报纸会剩余，剩余的报纸只能报废掉（这里假定，过期报纸价值会大大降低），并且当天无法进行再次补货。那么最关键的就是如何确定最佳订购量（一次决策），使期望利润最大化。\n模型推导\n先做如下定义：\n\np：price\nc：cost\n\\(c_e\\)：excess cost\n\\(c_s\\): shortage cost\nQ: quantity\nP(x): probability of demand\nE[x]: expected value of demand\ng: salvage value\nB: shortage penalty\nE[Units Short]: expected units short\nE[Units Sold]: expected units sold\nE[US]: expected units short\n\n最佳订购量 \\(Q^\\ast\\)\n利润方程可以表示为：\n$$Profit = p(\\min[x, Q]) - cQ$$\n在需求(Demand)是连续分布函数时，有两种成本:\n\n\\(c_eP[x \\leq Q]\\) = expected excess cost \\(\\space\\space\\)   i.e. having too much product\n\\(c_s(1-P[x \\leq Q])\\) = expected shortage cost \\(\\space\\space\\)   i.e. having too little product\n\n当 E[Excess Cost] &lt; E[Shortage Cost] 时，理性的选择是，增加订购量Q，二者相等时的Q即为最佳订购量\\(Q^\\ast\\)。\n$$\nc_eP[x \\leq Q] = c_s(1-P[x \\leq Q]) \\newline\nc_eP[x \\leq Q] + c_sP[x \\leq Q] = c_s \\newline\nP[x \\leq Q] = \\frac {c_s} {c_e + c_s} \\newline\n$$\n上述公式中，右侧被称为Critical Ratio(CR)。也就是说，为了最大化利润，最佳订购量(\\(Q^\\ast\\))覆盖的需求分布应该等于CR。\n另，根据如下公式，CR也可以表示为利润除以售价\n$$\nCR = \\frac {c_s} {c_e + c_s} = \\frac {p - c} {c + p - c} = \\frac {p - c} p\n$$\n当g/B存在时，直接影响的是\\(c_s\\)和\\(c_e\\)。这时，CR可以拓展为：\n$$\nc_s = p - c + B \\newline\nc_e = c - g \\newline\nCR = \\frac {c_s} {c_e + c_s} = \\frac {p - c + B} {p + B - g}\n$$\n在实际应用中，会发现真正困难的地方在于对需求分布，在缺乏相关数据时，市场或者销售人员有可能针对期望需求做出预测，但是需求的分布（\\(\\mu-\\sigma\\)）则几乎无法预测。所以，在Newvendor model中的预测，一定需求有数据支持（哪怕是使用 triangle distribution）。同时也需要注意，预测是会有偏差的，所以使用 Newsvendor model 时也格外留意有预测分布替代需求分布时可能带来的偏差。\nExpected Profits\n计算期望利润之前，要先了解期望销售数量和期望短缺数量。E[Units Short] 作为E[Units Short | Q]的简写，指的是在订购量为Q是，期望短缺数量。同样的，E[Units Sold]指的是在订购量为Q是，期望销售数量。这两者都和订购数量Q有关。而E[Units Demand]是期望需求，和Q无关。下面来看这三者的关系。\n对于需求分布函数\\(\\f_x(x)))，订购数量Q。当需求x低于Q时，销售的数量为需求数量x；当需求数量x高于Q时，销售数量为Q（因为只有Q的库存量）。可以表示为：\n$$\nE[Units Sold] = \\int_{x=0}^{Q} x f_x(x)dx + Q\\int_{x=Q}^{\\infty} f_x(x)dx \\newline\nE[Units Short] = \\int_{x=Q}^{\\infty} (x-Q)f_x(x)dx \\newline\nE[Units Demand] = \\int_{x=0}^{\\infty} x f_x(x)dx\n$$\n根据上述公式，可以看到：\n$$E[Units Demand] = E[Units Sold] + E[Units Short] $$\n现在回到期望利润，首先利润和订购数量Q，需求x可以表述为：\n$$\nProfit(Q, x) = \\begin{cases}\npx - cQ &amp; \\text{if } {x \\leq Q }\n\\\\pQ - cQ &amp; \\text{if } {x &gt; Q}\n\\end{cases}\n$$\n对上述公式进行积分:\n$$\nE[Profit(Q, x)] = \\int_{x=0}^{Q}(px - cQ)f_x(x_0) dx_0 + \\int_{x=Q}^{\\infty} (pQ - cQ)f_x(x_0) dx_0 \\newline\nE[Profit(Q, x)] = p\\int_{0}^{\\infty}(x)f_x(x_0)dx_0 - cQ - p\\int_{Q}^{\\infty}(x-Q)f_x(x_0)dx_0 \\newline\nE[Profit(Q, x)] = pE[x] - cQ - pE[UnitsShort]\n$$\n这里还有另外一种表述(两者结果一致):\n$$\nE[Profit(Q, x)] = pE[UnitsSold] - cQ \\newline\nE[Profit(Q, x)] = pE[x] - cQ - pE[UnitsShort]\n$$\n其中，E[x]可以根据需求分布计算，Q可以根据需求分布和CR计算，E[UnitsShort]（后续简写为E[US]），稍后讨论如何根据需求分布来计算。所以，最终的计算公式为：\n\n$$ E[Profit(Q, x)] = pE[x] - cQ - pE[US] $$\n\n同样的，当存在g/B时，可以拓展上面的公式:\n$$\nP(Q) = \\begin{cases}\npx - cQ + g(Q-X) &amp; \\text{if } {x \\leq Q }\n\\\\pQ - cQ - B(x-Q) &amp; \\text{if } {x &gt; Q}\n\\end{cases} \\newline\nE[P(Q)] = (p-g)E[x] - (c-g)Q - (p-g+B)E[US] \\newline\nE[P(Q)] = p(E[x] - E[US]) - cQ - g(Q - (E[x] - E[US])) - BE[US]\n$$\nUnit Normal Loss Function\n对于正态分布的需求，定义G(k):\n$$ E[US] = \\int_{x=Q}^{\\infty} (x-Q)f_x(x)dx = \\sigma G(\\frac {Q-\\mu} \\sigma) = \\sigma G(k) $$\n其中：\n$$ k = \\frac {(Q-\\mu)} \\sigma \\newline\nG(k) = f_x(x_0) - k*Prob[x_0 ] $$\n在Excel中，可以用如下公式计算:\n\nG(k)=NORMDIST(k, 0, 1, 0)-k*(1-NORMSDIST(k)).\n\nsummary\nNewsvendor model 在时尚类产品中有很好的应用，主要原因在于：面对不确定的需求。供应链的核心挑战之一就是如何应对不确定性。在实际使用过程中，确定需求分布的参数是非常容易产生较大误差的地方。同时也要了解不同的需求分布参数对最终的最佳订购量\\(Q^\\ast\\)和E[Profit(Q)]都会有很大的影响。\n","id":"https://blog.xiongdong57.top/newsvendor-model/","title":"Newsvendor model"},"https://blog.xiongdong57.top/process-analysis/":{"body":"在讨论库存的时候，往往指的是涉及到和销售有关的实物。实际上，这个概念可以拓展到更一般的层面上，医院中排队的病人，呼叫中心等待的服务等都可以视作「库存」。在讨论实物库存时，stockout 导向的往往是损失；而在涉及到服务相关的库存（尤其是存在排队现象时），stockout 导向的是更好的服务水平（也许会对应更高昂的成本）。从这两个角度，虽然侧重不同，但难点都在于「供需匹配」。\n\n这里，用流程的观点来看待库存。首先，流程绩效有如下度量指标：\n\nflow unit：流程单位\ninventory：库存\nflow time：一个 flow unit 经过一个流程所需要的时间\nflow rate：流程的单位时间产出\ncapacity：流程能力\n\n根据 Little's Law\n\n平均库存 = 平均单位时间产出 * 平均流程时间\n\n当把一家公司看作一个销售流程时，库存周转天数的含义是需要多长的时间，可以将一块钱的投资转为收入（财务报表中通常会是 turnover days 或者 days of supply）。从这个角度，也就更加能够理解为什么库存周转的重要性了。而库存周转次数为：\n\n库存你周转次数 = 1/流程时间\n\n当涉及到多个流程的时候：\n流程能力 = min {资源1的能力，资源2的能力，...}\n单位时间产出 = min {可得输入，需求，流程能力}\n这个思路可以拓展在更复杂的情况下，比如：流水线平衡、排队问题中预测排队时间和服务水平以及质量管理等。\n","id":"https://blog.xiongdong57.top/process-analysis/","title":"Process Analysis"}},"docInfo":{"https://blog.xiongdong57.top/":{"body":0,"title":0},"https://blog.xiongdong57.top/advent-of-code-2021/":{"body":2370,"title":3},"https://blog.xiongdong57.top/eoq-model/":{"body":510,"title":2},"https://blog.xiongdong57.top/linux-server/":{"body":141,"title":5},"https://blog.xiongdong57.top/modern-pandas/":{"body":63,"title":2},"https://blog.xiongdong57.top/multi-period-inventory-models/":{"body":253,"title":4},"https://blog.xiongdong57.top/newsvendor-model/":{"body":363,"title":2},"https://blog.xiongdong57.top/process-analysis/":{"body":22,"title":2}},"length":8},"lang":"English"}